{"query":"
        query TrendingHomeNftCollections($period: NftCollectionPeriod!, $network: Network, $first: Int) {
          nftTrendingCollections(
            input: {
              period: $period
              network: $network
              order: { orderBy: ETH_VOLUME, orderDirection: DESC }
              first: $first
            }
          ) {
            edges {
              cursor
              node {
                name
                network
                description
                logoImageUrl
                address
                bannerImageUrl
                cardImageUrl
                floorPriceEth
                stats {
            dailyVolumeEth
            dailyVolumeEthPercentChange
          }
              }
            }
          }
        }
      ","variables":{"network":"ETHEREUM_MAINNET","period":"DAILY","first":17}}

{"query":"
        fragment ImageFragment on Image {
  ... on Image {
    __typename
    thumbnail: url(input: { size: THUMBNAIL })
    mediumImage: url(input: { size: MEDIUM })
    largeImage: url(input: { size: LARGE })
    originalImage: url(input: { size: ORIGINAL })
  }
}
        query FeaturedNftCollectionQuery {
          featuredCollections {
            address
            name
            network
            logoImageUrl
            supply
            floorPriceEth
            marketCap
            stats {
              monthlyTopSale {
                token {
                  medias {
                    ...ImageFragment
                  }
                }
              }
            }
          }
        }
      "}
